window.bookSummaryJSON = "<p>I had a plan, and it was solid.</p> <p>Track down what was hidden away and take pleasure in toying with it.&nbsp;</p> <p>Toying with her.&nbsp;</p> <p>That plan, it worked like a charm.</p> <p>Until it didn't.&nbsp;</p> <p>Turned out, the feisty little thing I found was far from what I hoped for.&nbsp;</p> <p>She was different from all I knew and more than I expected.</p> <p>She was light, and I'm the bastard who led her into darkness.</p> <p>But this girl...she followed with a smile.</p> <p>I told her I break pretty things.</p> <p>She asked me to promise.</p>"; 
